    {
        string? filterById = null;
        try
        {
            filterById = changeEventArgs.Value.ToString();
        }
        catch (Exception e)
        {
        }
        if (filterById != null)
        {
            adultList = adults.Where(t => t.FirstName == filterById).ToList();
            adultList = adults;
        }
